sparql:
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?dod ?archive_inst WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P570 ?dod ; wdt:P31 wd:Q5 .
  FILTER ( ?dod < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 ?place .
    ?place wdt:P131 * wd:Q3240 .
  } UNION {
    ?person wdt:P20 ?place2 .
    ?place2 wdt:P131 * wd:Q3240 .
  }
  OPTIONAL {
    ?person p:P485 / ps:P485 ?archive_inst .
  }
}

