sparql:
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?networth ?unit ?conversion ?networth_usd WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?st .
  ?st ps:P2218 ?networth .
  OPTIONAL {
    ?st pq:P38 ?unit .
  }
  OPTIONAL {
    ?st pq:P2284 ?conversion .
  }
  BIND( IF( bound( ?unit ) && ?unit = wd:Q4917 , 1 , IF( bound( ?conversion ) , ?conversion , 1 ) ) AS ?conv ) BIND( xsd:decimal ( ?networth ) * xsd:decimal ( ?conv ) AS ?networth_usd ) FILTER ( ?networth_usd >= 1000000000 )
}
ORDER BY DESC ( ?networth_usd )

function.arguments:
{"kg":"wikidata","sparql":"SELECT DISTINCT ?person ?networth ?unit ?conversion ?networth_usd WHERE {
