  ?person p:P2218 ?st.
  ?st ps:P2218 ?networth.
  OPTIONAL {
    ?st pq:P38 ?unit. # currency
  }
  OPTIONAL {
    ?st pq:P2284 ?conversion. # conversion rate to USD
  }
  BIND(IF(bound(?unit) && ?unit = wd:Q4917, 1, IF(bound(?conversion), ?conversion, 1)) AS ?conv)
  BIND(xsd:decimal(?networth) * xsd:decimal(?conv) AS ?networth_usd)
  FILTER(?networth_usd >= 1000000000)
