sparql:
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?numPartners ( SUM( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?numFemale ) ( SUM( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?numMale ) WHERE {
  ?artist wdt:P106 / wdt:P279 * wd:Q108289408 .
  ?artist wdt:P21 ?gender .
  FILTER ( ?gender IN ( wd:Q6581097 , wd:Q6581072 ) ) OPTIONAL {
    ?artist wdt:P451 ?partner
  }
  BIND( COUNT( DISTINCT ?partner ) AS ?numPartners )
}
GROUP BY ?numPartners

