PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?entity ?entityLabel ?area ?parentCountry ?parentCountryLabel WHERE {
  {
    ?entity wdt:P31 / wdt:P279 * wd:Q6256 ; wdt:P30 wd:Q46 ; wdt:P2046 ?area .
    FILTER NOT EXISTS {
      ?entity wdt:P576 ?dissolved .
    }
    BIND( ?entity AS ?parentCountry )
  } UNION {
    ?entity wdt:P31 / wdt:P279 * wd:Q82794 ; wdt:P30 wd:Q46 ; wdt:P17 ?parentCountry ; wdt:P2046 ?area .
    FILTER NOT EXISTS {
      ?entity wdt:P576 ?dissolved .
    }
    FILTER ( ?area > 10000 )
  }
  OPTIONAL {
    ?entity rdfs:label ?entityLabel FILTER ( LANG( ?entityLabel ) = "en" )
  }
  OPTIONAL {
    ?parentCountry rdfs:label ?parentCountryLabel FILTER ( LANG( ?parentCountryLabel ) = "en" )
  }
}
ORDER BY DESC ( ?area )

