PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?entity ?label ?pop ?popDate ?area WHERE {
  VALUES ( ?entity ?label ?latestPopDate ) {
    ( wd:Q884 "South Korea" @en "2022-01-01T00:00:00Z" ^^ xsd:dateTime ) ( wd:Q31057 "Norfolk Island" @en "2021-08-10T00:00:00Z" ^^ xsd:dateTime ) ( wd:Q35555 "Wallis and Futuna" @en "2018-01-01T00:00:00Z" ^^ xsd:dateTime ) ( wd:Q220982 "Tristan da Cunha" @en "2019-01-01T00:00:00Z" ^^ xsd:dateTime ) ( wd:Q31063 "Christmas Island" @en "2021-08-10T00:00:00Z" ^^ xsd:dateTime ) ( wd:Q475038 "Galápagos Province" @en "2022-01-01T00:00:00Z" ^^ xsd:dateTime )
  }
  OPTIONAL {
    ?entity p:P1082 ?popStatement .
    ?popStatement ps:P1082 ?pop .
    OPTIONAL {
      ?popStatement pq:P585 ?popDate .
